description:
"Convenient travel, eTranslator first; Enjoy the journey and translate as you please."

Featured functions:
【iOS18 feature 】· No offline translation function

[Super practical travel tool] · Exchange rate, time difference calculation, unit conversion tool

【 Intelligent simultaneous interpretation 】· Real-time voice input, one-click switching language selection, to meet the needs of a variety of professional scenes such as meetings and classes

【 Main function of translation 】
Support 100+ language translation;
Provide text translation, voice translation, photo translation, picture translation of a variety of forms to choose from
Automatically detect the input language, read the text with one click, and quickly extract the picture text

【 Situation translation 】
Preset a variety of use scenarios, provide hundreds of dialogue references, including: restaurants, scenic spots, shopping, hotels and other scenes

【 Quick operation 】
Provides convenient operations such as desktop widgets, shortcuts, and quick operations to improve usage efficiency

Subscription auto-renewal related information:
Subscription service-After subscribing, you can unlock access to all functions in the app;
Subscription period-For example, continuous weekly subscription: subscription period is 1 week; continuous monthly subscription: subscription period is 1 month; continuous annual subscription: subscription period is 1 year;
Subscription price-Specific information is subject to IAP information; for example, continuous weekly subscription is 8 yuan per week;
Payment-After the user confirms the purchase and pays, it will be charged to the iTunes account;
Free trial-If you renew or cancel the renewal again during the free trial period, the free trial rights will not be withdrawn from the user, and the user can try it until the end of the trial period;
Renewal-"Weekly/Monthly/Yearly Subscription" products are auto-renewal products. After confirming the purchase, the fee will be deducted from your iTunes account. The subscription will be automatically renewed unless the auto-renewal is turned off at least 24 hours before the end of the current subscription;
Within 24 hours before the expiration of your subscription period, Apple will automatically deduct the fee from your iTunes account, and the membership validity period will be automatically extended by one period after success;
Cancel subscription-If you need to cancel the subscription, please click "Settings" on your phone, click "Apple ID", choose to enter the "Subscription" page, and choose the corresponding membership service to cancel the subscription.

